import React, { Component } from 'react';
import "./marker.css";
import classes from '*.module.sass';


class Marker extends Component {

    render() {
        let classes = "marker";
        if (this.props.selected) {
            classes += "selected";
        }

        return (
            <div className={classes}>
                {this.props.text}
            </div>
        );
    }
}

export default Marker;
